import React from 'react';

function ApplicantList({ applicants, onSelectApplicant, selectedApplicants }) {
  if (!applicants || applicants.length === 0) {
    return (
      <div className="no-results">
        <p>No applicants found matching your filters.</p>
      </div>
    );
  }

  return (
    <div className="applicant-list">
      <h2>Applicants ({applicants.length})</h2>

      <table className="applicant-table">
        <thead>
          <tr>
            <th>Select</th>
            <th>ID</th>
            <th>Name</th>
            <th>Location</th>
            <th>Driver's License</th>
            <th>Skills</th>
          </tr>
        </thead>
        <tbody>
          {applicants.map(applicant => (
            <tr key={applicant.id} className={selectedApplicants.includes(applicant.id) ? 'selected' : ''}>
              <td>
                <input 
                  type="checkbox"
                  checked={selectedApplicants.includes(applicant.id)}
                  onChange={(e) => onSelectApplicant(applicant.id, e.target.checked)}
                />
              </td>
              <td>{applicant.id}</td>
              <td>{applicant.name}</td>
              <td>{applicant.location}</td>
              <td>{applicant.driversLicence}</td>
              <td>{applicant.skills?.join(', ') || 'N/A'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ApplicantList;
